INSERT INTO `topic` VALUES (144, 'Java 简介', 'Java是由Sun Microsystems公司于1995年5月推出的Java面向对象程序设计语言和Java平台的总称。由James Gosling和同事们共同研发，并在1995年正式推出。\n\nJava分为三个体系：\n\nJavaSE（J2SE）（Java2 Platform Standard Edition，java平台标准版）\nJavaEE(J2EE)(Java 2 Platform,Enterprise Edition，java平台企业版)\nJavaME(J2ME)(Java 2 Platform Micro Edition，java平台微型版)。\n2005年6月，JavaOne大会召开，SUN公司公开Java SE 6。此时，Java的各种版本已经更名以取消其中的数字\"2\"：J2EE更名为Java EE, J2SE更名为Java SE，J2ME更名为Java ME。', 3, '2019-12-18 19:37:15', 80, 10, 0, 0, 1, 1, NULL);
INSERT INTO `topic` VALUES (145, 'Java 基础语法', '一个 Java 程序可以认为是一系列对象的集合，而这些对象通过调用彼此的方法来协同工作。下面简要介绍下类、对象、方法和实例变量的概念。\n\n对象：对象是类的一个实例，有状态和行为。例如，一条狗是一个对象，它的状态有：颜色、名字、品种；行为有：摇尾巴、叫、吃等。\n类：类是一个模板，它描述一类对象的行为和状态。\n方法：方法就是行为，一个类可以有很多方法。逻辑运算、数据修改以及所有动作都是在方法中完成的。\n实例变量：每个对象都有独特的实例变量，对象的状态由这些实例变量的值决定。', 3, '2019-12-18 19:39:38', 5, 10, 0, 1, 0, 1, NULL);
INSERT INTO `topic` VALUES (146, 'Java 正则表达式怎么使用', '如何从一个给定的字符串中找到数字串\n匹配所有数字', 3, '2019-12-18 19:41:16', 7, -100, 1, 0, 0, 1, NULL);
INSERT INTO `topic` VALUES (180, '有没有什么好看的修仙小说，求推荐', '如题，，/(ㄒoㄒ)/~~，😬', 1, '2019-12-22 12:16:29', 8, -10, 1, 0, 1, 3, 24);
INSERT INTO `topic` VALUES (181, '红楼梦', '“红楼梦以贾、史、王、薛四大家族的兴衰为背景，以贾宝玉和林黛玉的爱情悲剧为主线，描写了以贾家为代表的四大家族的兴衰，揭示了封建大家庭的各种错综复杂的矛盾，表现了封建的婚姻、道德、文化、教育的腐朽、堕落。”', 1, '2019-12-22 12:56:48', 4, 10, 0, 0, 0, 4, NULL);
