INSERT INTO `topic` VALUES (183, '西游记，两开花', '“唐朝太宗贞观年间孙悟空、猪八戒、沙僧、白龙马四人保护唐僧西行取经，沿途历经磨难（连同唐僧出生到取经前的磨难共九九八十一难），一路降妖伏魔，化险为夷，最后到达西天，取得真经的故事。”', 2, '2019-12-22 13:11:30', 3, 10, 0, 0, 0, 4, NULL);
